package myfirstpackage;

public class Ftoc {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println((31-32)*(5.0/9.0));//FtoC
		System.out.println((10*(9.0/5.0))+32);//CtoF
		System.out.println((60*90)/100);
		System.out.println((50*60)/100);

	}

}
